registerAnimator('parallax', class {
  constructor(options, state) {
    this.options_ = options;
    this.state_ = state || {
      value: Math.random()
    };
  }

  static get inputProperties() {
    return [
      '--parallax-speed',
      '--parallax-depth',
    ];
  }

  animate(timelines, effect) {
    console.log(this, '\nTHIS\n');
    console.log(timelines, '\nTIMELINES\n');
    console.log(effect, '\nEFFECT\n');
  }

  destroy() {
    return this.state_;
  }
});
